import { NavLink } from 'react-router-dom'


const style = {
    width: '100px',
    padding: '12px',
    margin: '0 6px 6px',
    background: 'darkgreen',
    textDecoration: 'none',
    color: 'white'
}
// creating the navbar

const NavBar = () => {
        return (
            <div>
                <NavLink
                    activeStyle={{
                        fontweight: "bolder",
                        color: 'darkgrey'
                    }}
                        exact
                        style={style}
                        to="/">
                    Home
                </NavLink>
                <NavLink
                    activeStyle={{
                        fontWeight: "bolder",
                        color: "lightgrey"
            }}
                        exact
                        style={style}
                        to="/TodoList">
                    New Todo List
                </NavLink>
                <NavLink
                    activeStyle={{
                        fontWeight: "bolder",
                        color: "lightgrey"
            }}
                        exact
                        style={style}
                        to="/NewTodoContainer">
                    Existing Todo List
                </NavLink>

            </div>
        )
        // putting in the links
    }


export default NavBar
